import React, { Component } from 'react';
import Navigationbar from '../../navigation';
// import userProfile from './profile';
import '@fortawesome/fontawesome-free/css/all.min.css';
// import backgroundImage from '../images/menuCard.jpg';
import { Redirect } from 'react-router';
import { Link } from 'react-router-dom';
import { Form, Button, Card, CardGroup} from 'react-bootstrap';
import axios from 'axios';
// import { getMainCourse } from './getMaincourse';

export class getRegUserList extends Component {
    constructor(props) {
        super(props);
        this.state = {
            regUserList: []
        };
    }

    componentDidMount() {
        axios.get(`http://localhost:3001/yelp/regUser/${localStorage.getItem("event_name")}`)
        .then(res => {
            //console.log(res.data)
            this.setState({ regUserList: res.data });
            //console.log(this.state.appetizerList);
        });
    }

    render () {
        console.log(this.state.appetizerList);
        let renderRegUser = this.state.regUserList.map(user => {
            return (
                <div>
                    <Card>
                        <Card.Title>{user.dish_name} </Card.Title>
                        <Card.Text>{user.ingredients}</Card.Text>
                        <Card.Text>{user.description}</Card.Text>
                        <Card.Text> ${user.price}</Card.Text>
                    </Card>
                    <br/>
                    <br/>
                </div>
            )
        })
        return (
            <React.Fragment>
                <Navigationbar/>
                <div>
                <div class='navbar'>
                </div>
                <div class='container'> 
                    {renderRegUser}
                </div>
                </div>
            </React.Fragment>
        )
    }

}
export default getRegUserList;
